webpackJsonp([0x7673de02f49f],{721:function(e,a){e.exports={data:{markdownRemark:{html:'<p>The Credential Management feature enables you to easily share access credentials with hackers so that you don\'t have to constantly create sign in credentials for each new hacker that participates in your program. This also enables participating hackers to quickly retrieve the credentials needed to find vulnerabilities in your program.</p>\n<blockquote>\n<p>Note: This feature is currently only available for private programs.</p>\n</blockquote>\n<h3>Set Up</h3>\n<p>To set up Credential Management for your program:</p>\n<ol>\n<li>Go to <b>Settings > General > Credential Management</b>.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-65552.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 42.872008324661806%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential-management-1"\n        title=""\n        src="/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-e7ffa.png"\n        srcset="/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-49813.png 125w,\n/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-dc8a5.png 250w,\n/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-e7ffa.png 500w,\n/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-dda24.png 750w,\n/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-c5f18.png 1000w,\n/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-22484.png 1500w,\n/static/credential-management-1-66249bf1d95fafa424eeebde1fc690f0-65552.png 1922w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="2">\n<li>Click <b>Import Credentials</b>.</li>\n<li>Click <b>Upload CSV file</b> to upload the CSV file of credentials that you want to share. The CSV file supports a set of headers and values where each row is a set of credentials that can be claimed by a hacker.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-2-063612e2137cf5479bdcadbce7e09a2d-50fd0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 54.12566237698713%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential-management-2"\n        title=""\n        src="/static/credential-management-2-063612e2137cf5479bdcadbce7e09a2d-e7ffa.png"\n        srcset="/static/credential-management-2-063612e2137cf5479bdcadbce7e09a2d-49813.png 125w,\n/static/credential-management-2-063612e2137cf5479bdcadbce7e09a2d-dc8a5.png 250w,\n/static/credential-management-2-063612e2137cf5479bdcadbce7e09a2d-e7ffa.png 500w,\n/static/credential-management-2-063612e2137cf5479bdcadbce7e09a2d-dda24.png 750w,\n/static/credential-management-2-063612e2137cf5479bdcadbce7e09a2d-c5f18.png 1000w,\n/static/credential-management-2-063612e2137cf5479bdcadbce7e09a2d-50fd0.png 1321w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="4">\n<li>Click <b>Next</b>.</li>\n<li>Review your uploaded credentials in the preview window and click <strong>Next</strong>.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-3-53c6d48deca65332161bddf9f8e5bf91-1f261.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.48858447488584%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential management preview"\n        title=""\n        src="/static/credential-management-3-53c6d48deca65332161bddf9f8e5bf91-e7ffa.png"\n        srcset="/static/credential-management-3-53c6d48deca65332161bddf9f8e5bf91-49813.png 125w,\n/static/credential-management-3-53c6d48deca65332161bddf9f8e5bf91-dc8a5.png 250w,\n/static/credential-management-3-53c6d48deca65332161bddf9f8e5bf91-e7ffa.png 500w,\n/static/credential-management-3-53c6d48deca65332161bddf9f8e5bf91-dda24.png 750w,\n/static/credential-management-3-53c6d48deca65332161bddf9f8e5bf91-c5f18.png 1000w,\n/static/credential-management-3-53c6d48deca65332161bddf9f8e5bf91-1f261.png 1314w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="6">\n<li>Write instructions you want to communicate to the hacker when they claim one of your credentials.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-4a-f083751e24a5e6659ef99594579e1d43-ae83b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60.24371667936024%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential instructions"\n        title=""\n        src="/static/credential-management-4a-f083751e24a5e6659ef99594579e1d43-e7ffa.png"\n        srcset="/static/credential-management-4a-f083751e24a5e6659ef99594579e1d43-49813.png 125w,\n/static/credential-management-4a-f083751e24a5e6659ef99594579e1d43-dc8a5.png 250w,\n/static/credential-management-4a-f083751e24a5e6659ef99594579e1d43-e7ffa.png 500w,\n/static/credential-management-4a-f083751e24a5e6659ef99594579e1d43-dda24.png 750w,\n/static/credential-management-4a-f083751e24a5e6659ef99594579e1d43-c5f18.png 1000w,\n/static/credential-management-4a-f083751e24a5e6659ef99594579e1d43-ae83b.png 1313w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="7">\n<li>Click <strong>Done</strong>.</li>\n</ol>\n<p>Your uploaded credentials will populate on your Credential Management page where you can see which credentials have or haven’t been claimed. Claimed credentials will also display the username of the hacker under the <b>Claimed by</b> column.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-5a-b37cc35483176cb3079e7f6752856c90-f615c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 37.714285714285715%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential-management-3"\n        title=""\n        src="/static/credential-management-5a-b37cc35483176cb3079e7f6752856c90-e7ffa.png"\n        srcset="/static/credential-management-5a-b37cc35483176cb3079e7f6752856c90-49813.png 125w,\n/static/credential-management-5a-b37cc35483176cb3079e7f6752856c90-dc8a5.png 250w,\n/static/credential-management-5a-b37cc35483176cb3079e7f6752856c90-e7ffa.png 500w,\n/static/credential-management-5a-b37cc35483176cb3079e7f6752856c90-dda24.png 750w,\n/static/credential-management-5a-b37cc35483176cb3079e7f6752856c90-c5f18.png 1000w,\n/static/credential-management-5a-b37cc35483176cb3079e7f6752856c90-f615c.png 1400w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<blockquote>\n<p><i>If a hacker has violated your policy or HackerOne’s code of conduct, you can revoke the credential rights of a hacker by clicking <b>Revoke</b> next to the username of the hacker. You\'ll also need to invalidate the account on your own platform to prevent the hacker from logging in.</i></p>\n</blockquote>\n<p>The username of the account the hacker created using the provided credentials will display on the submitted report under the <b>Account details used</b> section.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-4-4d6415991a8d5b396c0c0007604ae9e5-b2486.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 36.82634730538922%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential-management-4"\n        title=""\n        src="/static/credential-management-4-4d6415991a8d5b396c0c0007604ae9e5-e7ffa.png"\n        srcset="/static/credential-management-4-4d6415991a8d5b396c0c0007604ae9e5-49813.png 125w,\n/static/credential-management-4-4d6415991a8d5b396c0c0007604ae9e5-dc8a5.png 250w,\n/static/credential-management-4-4d6415991a8d5b396c0c0007604ae9e5-e7ffa.png 500w,\n/static/credential-management-4-4d6415991a8d5b396c0c0007604ae9e5-b2486.png 668w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>How It Works</h3>\n<p>Once you’ve set up credential management, hackers participating in your program will be able to retrieve their credentials by clicking the <b>Show Credentials</b> button on your security page.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-cd054.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 39.8248325605358%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential-management-5"\n        title=""\n        src="/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-e7ffa.png"\n        srcset="/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-49813.png 125w,\n/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-dc8a5.png 250w,\n/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-e7ffa.png 500w,\n/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-dda24.png 750w,\n/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-c5f18.png 1000w,\n/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-22484.png 1500w,\n/static/credential-management-5-853f6e96d17fef23986b744deb0ba8a3-cd054.png 1941w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The <b>Credentials</b> window will then display with instructions where the hacker can claim one of the credentials you’ve provided. They’ll be prompted to enter the username of the account they created using the credentials provided.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/credential-management-6a-105bee2194436a05ec67a174814a2bdd-d39cc.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 449px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 85.07795100222717%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="credential-management-6"\n        title=""\n        src="/static/credential-management-6a-105bee2194436a05ec67a174814a2bdd-7de25.png"\n        srcset="/static/credential-management-6a-105bee2194436a05ec67a174814a2bdd-538c0.png 125w,\n/static/credential-management-6a-105bee2194436a05ec67a174814a2bdd-35514.png 250w,\n/static/credential-management-6a-105bee2194436a05ec67a174814a2bdd-7de25.png 500w,\n/static/credential-management-6a-105bee2194436a05ec67a174814a2bdd-32fad.png 750w,\n/static/credential-management-6a-105bee2194436a05ec67a174814a2bdd-d39cc.png 898w"\n        sizes="(max-width: 449px) 100vw, 449px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/programs/credential-management.html",id:"programs/credential-management",title:"Credential Management",description:null}}},pathContext:{}}}});
